<B>使用方法</B><BR>
小糸シールドビームハンドランプ(HAND LANP)は、シガレットにプラグを差し込み灯具のスイッチを押すだけで点灯しします<BR>
灯具を自由に移動でき、手近な場所に吊るしても使用できます。<BR><BR>
<B>商品サイス</b><BR>
・ライト部80mm<br>
・本体230mm（コード含まない）<br>
・コード部約3,000mm<br>
<br><br>






