<!--店舗実況-->

<!--店舗実況-->

アドバンスフォーカスを搭載<br>2段階調光可能。テールスイッチを搭載。 テールスイッチを半押しするとHiモード点灯、離すと消灯。2回連続で半押するとLowモード点灯。クリック音がするまで押し込むと任意の明るさで常時点灯。<br>専用充電器は充電中は赤色、満充電で緑色に点灯<br>電源：専用ニッケル水素充電池（内蔵）または単4形アルカリ電池(3個)<br>充電時間:4時間<br>最大点灯時間：約25時間（≧1lm）<br>全長×ボディ径×ヘッド径170mm×14.7mm×18.5mm<br>照射距離(m):100<br>明るさ:MAX120ルーメン<br>最大点灯時間:約25時間(≧1lm)<br>連続点灯時間:25<br>質量:82g<br>電源：専用ニッケル水素充電池（内蔵）または単4形アルカリ電池(3個)<br>本体：アルミ<br><br><br>※2016年7月17日現在の情報です。最新情報はメーカーページをご確認ください。<style type="text/css">
